s.org/licenses/by-sa/3.0/"/> <link rel="canonical" href="https://en.wikipedia.org/wiki/Data"/> <link rel="dns-prefetch" href="//login.wikimedia.org"/> <link rel="dns-prefetch" href="//meta.wikimedia.org" /> <!--[if lt IE 9]><script src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Data rootpage-Data skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Data</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><div role="note" class="hatnote navigation-not-searchable">For data in computer science, see <a href="/wiki/Data_(computing)" title="Data (computing)">Data (computing)</a>. For other uses, see <a href="/wiki/Data_(disambiguation)" class="mw-disambig" title="Data (disambiguation)">Data (disambiguation)</a> and <a href="/wiki/Datum_(disambiguation)" class="mw-disambig" title="Datum (disambiguation)">Datum (disambiguation)</a>.</div> <div class="thumb tright"> <div class="thumbinner" style="width:202px;"><a href="/wiki/File:Data_types_-_en.svg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Data_types_-_en.svg/200px-Data_types_-_en.svg.png" width="200" height="208" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Data_types_-_en.svg/300px-Data_types_-_en.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Data_types_-_en.svg/400px-Data_types_-_en.svg.png 2x" data-file-width="437" data-file-height="455" /></a> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:Data_types_-_en.svg" class="internal" title="Enlarge"></a></div> Some of the different types of data.</div> </div> </div> <p><b>Data</b> (<span class="nowrap"><span class="IPA nopopups noexcerpt"><a href="/wiki/Help:IPA/English" title="Help:IPA/English">/<span style="border-bottom:1px dotted"><span title="/ˈ/: primary stress follows">ˈ</span><span title="'d' in 'dye'">d</span><span title="/eɪ/: 'a' in 'face'">eɪ</span><span title="'t' in 'tie'">t</span><span title="/ə/: 'a' in 'about'">ə</span></span>/</a></span></span> <a href="/wiki/Help:Pronunciation_respelling_key" title="Help:Pronunciation respelling key"><small title="English pronunciation respelling"><i><b>DAY</b>-tə</i></small></a>, <span class="nowrap"><span class="IPA nopopups noexcerpt"><a href="/wiki/Help:IPA/English" title="Help:IPA/English">/<span style="border-bottom:1px dotted"><span title="/ˈ/: primary stress follows">ˈ</span><span title="'d' in 'dye'">d</span><span title="/æ/: 'a' in 'bad'">æ</span><span title="'t' in 'tie'">t</span><span title="/ə/: 'a' in 'about'">ə</span></span>/</a></span></span> <a href="/wiki/Help:Pronunciation_respelling_key" title="Help:Pronunciation respelling key"><small title="English pronunciation respelling"><i><b>DA</b>-tə</i></small></a>, or <span class="nowrap"><span class="IPA nopopups noexcerpt"><a href="/wiki/Help:IPA/English" title="Help:IPA/English">/<span style="border-bottom:1px dotted"><span title="/ˈ/: primary stress follows">ˈ</span><span title="'d' in 'dye'">d</span><span title="/ɑː/: 'a' in 'father'">ɑː</span><span title="'t' in 'tie'">t</span><span title="/ə/: 'a' in 'about'">ə</span></span>/</a></span></span> <a href="/wiki/Help:Pronunciation_respelling_key" title="Help:Pronunciation respelling key"><small title="English pronunciation respelling"><i><b>DAH</b>-tə</i></small></a>)<sup id="cite_ref-1" class="reference"><a href="#cite_note-1">[1]</a></sup> is a <a href="/wiki/Set_(mathematics)" title="Set (mathematics)">set</a> of values of <a href="/wiki/Qualitative_property" title="Qualitative property">qualitative</a> or <a href="/wiki/Quantity" title="Quantity">quantitative</a> <a href="/wiki/Variable_(research)" class="mw-redirect" title="Variable (research)">variables</a>. Pieces of data are individual pieces of <a href="/wiki/Information" title="Information">information</a>. While the concept of data is commonly associated with <a href="/wiki/Scientific_research" class="mw-redirect" title="Scientific research">scientific research</a>, data is collected by a huge range of organizations and institutions, including businesses (e.g., sales data, revenue, profits, <a href="/wiki/Stock_price" class="mw-redirect" title="Stock price">stock price</a>), governments (e.g., <a href="/wiki/Crime_rate" class="mw-redirect" title="Crime rate">crime rates</a>, <a href="/wiki/Unemployment_rate" class="mw-redirect" title="Unemployment rate">unemployment rates</a>, <a href="/wiki/Literacy" title="Literacy">literacy</a> rates) and non-governmental organizations (e.g., censuses of the number of <a href="/wiki/Homelessness" title="Homelessness">homeless people</a> by non-profit organizations).</p> <p>Data is <a href="/wiki/Measurement" title="Measurement">measured</a>, <a href="/wiki/Data_reporting" title="Data reporting">collected and reported</a>, and <a href="/wiki/Data_analysis" title="Data analysis">analyzed</a>, whereupon it can be <a href="/wiki/Data_visualization" title="Data visualization">visualized</a> using graphs, images or other analysis tools. Data as a general <a href="/wiki/Concept" title="Concept">concept</a> refers to the fact that some existing <a href="/wiki/Information" title="Information">information</a> or <a href="/wiki/Knowledge" title="Knowledge">knowledge</a> is <i><a href="/wiki/Knowledge_representation_and_reasoning" title="Knowledge representation and reasoning">represented</a></i> or <i><a href="/wiki/Code" title="Code">coded</a></i> in some form suitable for better usage or <a href="/wiki/Data_processing" title="Data processing">processing</a>. <i><a href="/wiki/Raw_data" title="Raw data">Raw data</a></i> ("unprocessed data") is a collection of <a href="/wiki/Number" title="Number">numbers</a> or <a href="/wiki/Character_(computing)" title="Character (computing)">characters</a> before it has been "cleaned" and corrected by researchers. Raw data needs to be corrected to remove <a href="/wiki/Outlier" title="Outlier">outliers</a> or obvious instrument or data entry errors (e.g., a thermometer reading from an outdoor Arctic location recording a tropical temperature). Data processing commonly occurs by stages, and the "processed data" from one stage may be considered the "raw data" of the next stage. <a href="/wiki/Field_work" class="mw-redirect" title="Field work">Field data</a> is raw data that is collected in an uncontrolled "<a href="/wiki/In_situ" title="In situ">in situ</a>" environment. <a href="/wiki/Experimental_data" title="Experimental data">Experimental data</a> is data that is generated within the context of a scientific investigation by observation and recording. Data has been described as the new <a href="/wiki/Petroleum" title="Petroleum">oil</a> of the <a href="/wiki/Digital_economy" title="Digital economy">digital economy</a>.<sup id="cite_ref-2" class="reference"><a href="#cite_note-2">[2]</a></sup><sup id="cite_ref-3" class="reference"><a href="#cite_note-3">[3]</a></sup></p> <p></p> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Etymology_and_terminology"><span class="tocnumber">1</span> <span class="toctext">Etymology and terminology</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Meaning"><span class="tocnumber">2</span> <span class="toctext">Meaning</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#In_other_fields"><span class="tocnumber">3</span> <span class="toctext">In other fields</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#See_also"><span class="tocnumber">4</span> <span class="toctext">See also</span></a></li> <li class="toclevel-1 tocsection-5"><a href="#References"><span class="tocnumber">5</span> <span class="toctext">References</span></a></li> <li class="toclevel-1 tocsection-6"><a href="#External_links"><span class="tocnumber">6</span> <span class="toctext">External links</span></a></li> </ul> </div> <p></p> <h2><span class="mw-headline" id="Etymology_and_terminology">Etymology and terminology</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Data&amp;action=edit&amp;section=1" title="Edit section: Etymology and terminology">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>The first English use of the word "data" is from the 1640s. Using the word "data" to mean "transmittable and storable computer information" was first done in 1946. The expression "data processing" was first used in 1954.<sup id="cite_ref-eol_4-0" class="reference"><a href="#cite_note-eol-4">[4]</a></sup></p> <p>The <a href="/wiki/Data_(word)" title="Data (word)">Latin word <i>data</i></a> is the plural of <i>datum</i>, "(thing) given," neuter past participle of <i>dare</i> "to give".<sup id="cite_ref-eol_4-1" class="reference"><a href="#cite_note-eol-4">[4]</a></sup> Data may be used as a plural noun in this sense, with some writers in the 2010s using <i>datum</i> in the singular and <i>data</i> for plural. In the 2010s, though, in non-specialist, everyday writing, "data" is most commonly used in the singular, as a <a href="/wiki/Mass_noun" title="Mass noun">mass noun</a> (like "information", "sand" or "rain").<sup id="cite_ref-5" class="reference"><a href="#cite_note-5">[5]</a></sup></p> <h2><span class="mw-headline" id="Meaning">Meaning</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Data&amp;action=edit&amp;section=2" title="Edit section: Meaning">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>Data, <a href="/wiki/Information" title="Information">information</a>, <a href="/wiki/Knowledge" title="Knowledge">knowledge</a> and <a href="/wiki/Wisdom" title="Wisdom">wisdom</a> are closely related concepts, but each has its own role in relation to the other, and each term has its own meaning. According to a common view, data is collected and analyzed; data only becomes information suitable for making decisions once it has been analyzed in some fashion. <sup id="cite_ref-6" class="reference"><a href="#cite_note-6">[6]</a></sup> <a href="/wiki/Knowledge" title="Knowledge">Knowledge</a> is derived from extensive amounts of experience dealing with information on a subject. For example, the height of <a href="/wiki/Mount_Everest" title="Mount Everest">Mount Everest</a> is generally considered data. The height can be recorded precisely with an <a href="/wiki/Altimeter" title="Altimeter">altimeter</a> and entered into a database. This data may be included in a book along with other data on Mount Everest to describe the mountain in a manner useful for those who wish to make a decision about the best method to climb it. Using an understanding based on experience climbing mountains to advise persons on the way to reach Mount Everest's peak may be seen as "knowledge". Some complement the series "data", "information" and "knowledge" with "wisdom", which would mean the status of a person in possession of a certain "knowledge" who also knows under which circumstances is good to use it.</p> <p>Data is often assumed to be the least abstract concept, information the next least, and knowledge the most abstract.<sup id="cite_ref-7" class="reference"><a href="#cite_note-7">[7]</a></sup> In this view, data becomes information by interpretation; e.g., the height of Mount Everest is generally considered "data", a book on Mount Everest geological characteristics may be considered "information", and a climber's guidebook containing practical information on the best way to reach Mount Everest's peak may be considered "knowledge". "Information" bears a diversity of meanings that ranges from everyday usage to technical use. This view, however, has also been argued to provide an upside-down model of the relation between data, information, and knowledge.<sup id="cite_ref-8" class="reference"><a href="#cite_note-8">[8]</a></sup> Generally speaking, the concept of information is closely related to notions of constraint, communication, control, data, form, instruction, knowledge, meaning, mental stimulus, pattern, perception, and representation. Beynon-Davies uses the concept of a <a href="/wiki/Sign" title="Sign">sign</a> to differentiate between data and information; data is a series of symbols, while information occurs when the symbols are used to refer to something.<sup id="cite_ref-9" class="reference"><a href="#cite_note-9">[9]</a></sup><sup id="cite_ref-10" class="reference"><a href="#cite_note-10">[10]</a></sup></p> <p>Before the development of computing devices and machines, only people could collect data and impose patterns on it. Since the development of computing devices and machines, these devices can also collect data. In the 2010s, computers are widely used in many fields to collect data and sort or process it, in disciplines ranging from <a href="/wiki/Marketing" title="Marketing">marketing</a>, analysis of <a href="/wiki/Social_services" title="Social services">social services</a> usage by citizens to scientific research. These patterns in data are seen as information which can be used to enhance knowledge. These patterns may be interpreted as "<a href="/wiki/Truth" title="Truth">truth</a>" (though "truth" can be a subjective concept), and may be authorized as aesthetic and ethical criteria in some disciplines or cultures. Events that leave behind perceivable physical or virtual remains can be traced back through data. Marks are no longer considered data once the link between the mark and observation is broken.<sup id="cite_ref-11" class="reference"><a href="#cite_note-11">[11]</a></sup></p> <p>Mechanical computing devices are classified according to the means by which they represent data. An <a href="/wiki/Analog_computer" title="Analog computer">analog computer</a> represents a datum as a voltage, distance, position, or other physical quantity. A <a href="/wiki/Computer" title="Computer">digital computer</a> represents a piece of data as a sequence of symbols drawn from a fixed <a href="/wiki/Alphabet" title="Alphabet">alphabet</a>. The most common digital computers use a binary alphabet, that is, an alphabet of two characters, typically denoted "0" and "1". More familiar representations, such as numbers or letters, are then constructed from the binary alphabet. Some special forms of data are distinguished. A <a href="/wiki/Computer_program" title="Computer program">computer program</a> is a collection of data, which can be interpreted as instructions. Most computer languages make a distinction between programs and the other data on which programs operate, but in some languages, notably <a href="/wiki/Lisp_(programming_language)" title="Lisp (programming language)">Lisp</a> and similar languages, programs are essentially indistinguishable from other data. It is also useful to distinguish <a href="/wiki/Metadata" title="Metadata">metadata</a>, that is, a description of other data. A similar yet earlier term for metadata is "ancillary data." The prototypical example of metadata is the library catalog, which is a description of the contents of books.</p> <p><br /> <b>Data collection</b></p> <p>Gathering data can be accomplished through a primary source (the researcher is the first person to obtain the data) or a secondary source (the researcher obtains the data that has already been collected by other sources, such as data disseminated in a scientific journal). Data analysis methodologies vary and include data triangulation and data percolation <sup id="cite_ref-12" class="reference"><a href="#cite_note-12">[12]</a></sup>. The latter offers an articulate method of collecting, classifying and analyzing data using five possible angles of analysis (at least three) in order to maximize the research's objectivity and permit an understanding of the phenomena under investigation as complete as possible: qualitative and quantitative methods, literature reviews (including scholarly articles), interviews with experts, and computer simulation. The data are thereafter "percolated" using a series of pre-determined steps so as to extract the most relevant information.</p> <h2><span class="mw-headline" id="In_other_fields">In other fields</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Data&amp;action=edit&amp;section=3" title="Edit section: In other fields">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>Though data is also increasingly used in other fields, it has been suggested that the highly interpretive nature of them might be at odds with the ethos of data as "given". Peter Checkland introduced the term <i>capta</i> (from the Latin <i>capere</i>, “to take”) to distinguish between an immense number of possible data and a sub-set of them, to which attention is oriented.<sup id="cite_ref-13" class="reference"><a href="#cite_note-13">[13]</a></sup> <a href="/wiki/Johanna_Drucker" title="Johanna Drucker">Johanna Drucker</a> has argued that since the humanities affirm knowledge production as "situated, partial, and constitutive," using <i>data</i> may introduce assumptions that are counterproductive, for example that phenomena are discrete or are observer-independent.<sup id="cite_ref-14" class="reference"><a href="#cite_note-14">[14]</a></sup> The term <i>capta</i>, which emphasizes the act of observation as constitutive, is offered as an alternative to <i>data</i> for visual representations in the humanities.</p> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Data&amp;action=edit&amp;section=4" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <div class="div-col columns column-count column-count-5" style="-moz-column-count: 5; -webkit-column-count: 5; column-count: 5;"> <ul> <li><a href="/wiki/Biological_data" class="mw-redirect" title="Biological data">Biological data</a></li> <li><a href="/wiki/Data_acquisition" title="Data acquisition">Data acquisition</a></li> <li><a href="/wiki/Data_analysis" title="Data analysis">Data analysis</a></li> <li><a href="/wiki/Data_cable" title="Data cable">Data cable</a></li> <li><a href="/wiki/Dark_data" title="Dark data">Dark data</a></li> <li><a href="/wiki/Data_domain" title="Data domain">Data domain</a></li> <li><a href="/wiki/Data_element" title="Data element">Data element</a></li> <li><a href="/wiki/Data_farming" title="Data farming">Data farming</a></li> <li><a href="/wiki/Data_governance" title="Data governance">Data governance</a></li> <li><a href="/wiki/Data_integrity" title="Data integrity">Data integrity</a></li> <li><a href="/wiki/Data_maintenance" class="mw-redirect" title="Data maintenance">Data maintenance</a></li> <li><a href="/wiki/Data_management" title="Data management">Data management</a></li> <li><a href="/wiki/Data_mining" title="Data mining">Data mining</a></li> <li><a href="/wiki/Data_modeling" title="Data modeling">Data modeling</a></li> <li><a href="/wiki/Data_visualization" title="Data visualization">Data visualization</a></li> <li><a href="/wiki/Computer_da